import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './layout/Header';
import Home from './Component/HomeComponent/home';
import Footer from './layout/Footer';
import 'aos';

function App() {
 
  return (
    <>
    <Header/>
    <Home/>
    <Footer/>
    </>
  );
}

export default App;
